const totals={'First Year':{'1st Semester':{'lecture':266,'lab':42,'credit_units':308},'2nd Semester':{'lecture':308,'lab':28,'credit_units':336}},'Second Year':{'1st Semester':{'lecture':238,'lab':42,'credit_units':280},'2nd Semester':{'lecture':238,'lab':42,'credit_units':280}},'Third Year':{'1st Semester':{'lecture':210,'lab':42,'credit_units':252},'2nd Semester':{'lecture':196,'lab':56,'credit_units':252}},'Fourth Year':{'1st Semester':{'lecture':196,'lab':56,'credit_units':252},'2nd Semester':{'lecture':112,'lab':14,'credit_units':126}}};document.addEventListener("DOMContentLoaded",function(){for(const[year,semesters]of Object.entries(totals)){for(const[semester,details]of Object.entries(semesters)){document.getElementById(`lecture-${year}-${semester}`).innerText=details.lecture;document.getElementById(`lab-${year}-${semester}`).innerText=details.lab;document.getElementById(`credit_units-${year}-${semester}`).innerText=details.credit_units;}}});;